document.addEventListener('DOMContentLoaded', function () {
  const searchInput = document.getElementById('search-input');
  const searchResults = document.getElementById('search-results');

  searchInput.addEventListener('input', performSearch);

  document.addEventListener('click', function (e) {
    if (!searchInput.contains(e.target) && !searchResults.contains(e.target)) {
      searchResults.style.display = 'none';
    }
  });

  displayMediaByValue(sinais[0].value);
});

function performSearch() {
  const searchInput = document.getElementById('search-input');
  const searchResults = document.getElementById('search-results');
  const query = searchInput.value.trim().toLowerCase();

  searchResults.innerHTML = '';

  if (query.length < 2) {
    searchResults.style.display = 'none';
    return;
  }

  const matchingSinais = sinais.filter(sinal =>
    sinal.label.toLowerCase().includes(query)
  );

  if (matchingSinais.length > 0) {
    matchingSinais.forEach(sinal => {
      const resultItem = document.createElement('div');
      resultItem.classList.add('search-item');
      resultItem.textContent = sinal.label;

      resultItem.addEventListener('click', function () {
        displayMediaByValue(sinal.value);
        searchInput.value = sinal.label;
        searchResults.style.display = 'none';
      });

      searchResults.appendChild(resultItem);
    });
    searchResults.style.display = 'block';
  } else {
    const noResults = document.createElement('div');
    noResults.classList.add('no-results');
    noResults.textContent = 'Nenhum sinal encontrado';
    searchResults.appendChild(noResults);
    searchResults.style.display = 'block';
  }
}

function displayMediaByValue(value) {
  const container = document.getElementById('image-container');
  container.innerHTML = '';

  const isVideo = value.endsWith('.mp4');
  const sinal = sinais.find(s => s.value === value);
  const altText = sinal ? `Sinal em Libras para "${sinal.label}"` : 'Sinal em Libras';

  if (isVideo) {
    const video = document.createElement('video');
    video.src = value;
    video.controls = false;
    video.autoplay = true;
    video.loop = true;
    video.muted = true;
    video.style.maxWidth = '100%';
    video.style.width = '100%';
    video.style.height = 'auto';
    video.style.aspectRatio = '16/9';
    video.setAttribute('aria-label', altText);
    container.appendChild(video);
  } else {
    const image = document.createElement('img');
    image.src = value;
    image.alt = altText;
    image.id = 'displayed-image';
    image.style.maxWidth = '100%';
    container.appendChild(image);
  }
}

function displayImage() {
  const selector = document.getElementById('image-selector');
  const selectedValue = selector.value;
  displayMediaByValue(selectedValue);
}
